GAL trans is a Moldovan carrier company that operates regular bus services from Moldova to Romania, Ukraine and Russia.

With the application from GAL Trans you can easily:
– choose a flight suitable for the requested date;
– check buses routes on the map;
– see buses’ photos;
– make a reservation with payment to the driver during the boarding;
– pay for the ticket online;
– get access to the history of all purchased tickets in the personal account
– make a quick ticket return in your personal account
– request information from support service.

GAL Trans has a large bus fleet that meets European standards.

The professional drivers team will make sure that your trip is as comfortable as possible.

GAL Trans - it's important, who you travel with!

Таксопарк «Удача» — современное и удобное мобильное приложение для быстрого заказа такси онлайн. Больше никаких звонков! Пару кликов и Удача уже в пути к вам! Онлайн заказ такси «Удача» уже доступен в городах Тирасполь и Бендеры, а также в близлежайших населенных пунктах.
Преимущества мобильного приложения «Удача»:
— Вы получаете 2 бонуса с каждой поездки;
— современная карта с улучшенной геолокацией;
— возможность быстро заказать такси;
— Вы не тратите деньги и время на звонки оператору;
— опция предварительного заказа на определенное время;
— вся информация про авто, маршрут, стоимость и многое другое на экране вашего смартфона.

Загрузите приложение «Удача» на свой смартфон и отправляйтесь в путь уже сейчас!

С помощью этого приложения вы можете:

- проложить маршрут из точки А в точку Б и посмотреть каким видом транспорта можно добраться: маршрутки, автобусы, троллейбусы;
- увидеть маршрут на карте с остановками;
- посмотреть план движения конкретной маршрутки, автобуса, троллейбуса в городе;
- множество городов Украины.

Все данные по расписанию и маршруту транспорта предоставлены компанией «wikiroutes» https://wikiroutes.info.

